package Streams;import java.util.stream.Stream;public class parallel_operation {    public static void main(String[] args) {        System.out.println("forEach- ");        Stream.of("AAA","BBB","CCC","DDD","EEE").parallel().forEach(x-> System.out.println(x));        System.out.println("forEachOrder- ");        Stream.of("AAA","BBB","CCC","DDD","EEE").parallel().forEachOrdered(x-> System.out.println(x));    }}